import React from "react";
import Slider from "react-slick";



function SampleNextArrow(props) {
  const { className, style, onClick } = props;
  return (
    <button
      className='btn px-5 py-5 slick-btn-next'
      onClick={onClick}
    />
  );
}
function SamplePrevArrow(props) {
  const { className, style, onClick } = props;
  return (
    <button
      className='btn px-5 py-5 slick-btn-prev'
      onClick={onClick}
    />
  );
}




export default function Winners({ winners }) {

  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesPerRow: 3,
    rows: 7,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    responsive: [
      {
        breakpoint: 980,
        settings: {
          slidesPerRow: 2,
          rows: 10
        }
      },
      {
        breakpoint: 780,
        settings: {
          slidesPerRow: 1,
          rows: 14
        }
      }
    ]
  };
  let mass = winners['19 октября']
  console.log()
  return (
    <section className="winners pt-16 pb-32" id='winners'>
      <div className="container mx-auto relative">
        <h2 className="text-yellow text-center text-3xl xl:text-4xl 2xl:text-5xl">
          Победители
        </h2>
        <div className="mt-20 winners-content">
          <div className="winners-content-inner  mx-auto">
            <Slider {...settings} className='relative z-50 pt-16 px-16 pb-32'>
              {mass.map(
                (item, id) =>
                (
                  <p key={id} className='text text-black'>{item.name} <span className="text-bold">+7***{item.phone}</span></p>
                )
              )}
            </Slider>
          </div>
        </div>
      </div>
    </section>
  )
}
